import React, { useEffect, useState } from 'react'
import axios from "axios";
const UseEffectHook = () => {
    const [data, setdata] = useState("");
    useEffect(() => {
        axios.get("https://jsonplaceholder.typicode.com/posts")
            .then((res) => {
                setdata(res.dat);
            })
    }, [])
    return (
        <div>
            {
                res.data.map((r)=>{r})
            }
        </div>
    )
}

export default UseEffectHook;
